//======================================================================
//	GetStarter	(2)
//	指定されたコードポイントから starter 文字列を取り出し UCPSTRING に追加する。
//======================================================================
bool GetStarter(UCPSTRING* pucsDst, T_UCP cpSrc)
{
	PSDECOMPOSITION*	pdc;

	if (GetDecomposition(&pdc, cpSrc))
	{
		pucsDst->append(pdc->pcpStarter, (size_t)(pdc->nStarter));
		return true;
	}
	//	分解されない場合は、そのコードページの CCC が 0 の場合だけ追加すればよい。
	else
	{
		if (GetCanonicalCombiningClass(cpSrc) == 0)
		{
			pucsDst->append(1, cpSrc);
		}
		return true;
	}
	return false;
}

//======================================================================
//	GetStarter	(3)
//	指定されたコードポイント列を starter コードポイント列に変換する。
//======================================================================
bool GetStarter(UCPSTRING* pucsDst, UCPSTRING* pucsSrc)
{
	const T_UCP	*pcs;
	//T_UCP		cpd;

	if (pucsDst == NULL || pucsSrc == NULL)	return false;

	for (pcs = pucsSrc->c_str(); *pcs; ++pcs)
	{
		//	starter を追加できなかった場合は、
		//	元の文字を追加する。
		if (!GetStarter(pucsDst, *pcs))
		{
			pucsDst->append(1, *pcs);
		}
	}
	return true;
}

//======================================================================
//	GetStarter	(4)
//	指定されたコードポイントから starter 文字列を取り出し、Unicode 文字列に追加する。
//======================================================================
bool GetStarter(T_STRING_U* pstrBuf, const T_UCP cpSrc)
{
	PSDECOMPOSITION*	pdc;

	if (GetDecomposition(&pdc, cpSrc))
	{
		pstrBuf->append(pdc->pszStarter);
		return true;
	}
	return false;
}


